    "content": "## Create a new Astro project\n\n1. Run the following command:\n\n```bash\nnpm create astro@latest\n```\n\n2. Select the default options:\n\n```bash\n astro   Launch sequence initiated.\n\n   dir   Where should we create your new project?\n         ./astro-project\n\n  tmpl   How would you like to start your new project?\n         Include sample files\n\n    ts   Do you plan to write TypeScript?\n         Yes\n\n   use   How strict should TypeScript be?\n         Strict\n\n  deps   Install dependencies?\n         Yes\n\n   git   Initialize a new git repository?\n         Yes\n\n      âœ”  Project initialized!\n         â–  Template copied\n         â–  TypeScript customized\n         â–  Dependencies installed\n         â–  Git initialized\n```\n\n3. Add [**@astrojs/react**](https://docs.astro.build/es/guides/integrations-guide/react/) integration:\n\n```bash\nnpx astro add react\n```\n\n## Add the library\n\n1. Run the following command:\n\n<InstallLibrary />\n\n2. Add the JsonViewer to the page file:\n\n> ðŸ’¡ Add [`client:load`](https://docs.astro.build/es/reference/directives-reference/#clientload) directive to the `JsonViewer` component.\n\n```js {5,10}\n// ðŸ“„ pages/index.astro\n\n---\n\nimport { JsonViewer } from '@franmella/json-viewer';\n\n---\n\n<main>\n    <JsonViewer client:load />\n</main>\n```\n\n3. Pass the JSON data to the `JsonViewer` component:\n\n```js {5,7-17, 21}\n// ðŸ“„ pages/index.astro\n\n---\n\nimport { JsonViewer } from '@franmella/json-viewer';\n\nconst json = {\n  name: 'John Doe',\n  age: 30,\n  email: \"test@test.com\",\n  address: {\n    street: '123 Main St',\n    city: 'New York',\n    state: 'NY',\n    zip: '10001'\n  }\n}\n\n---\n\n<main>\n    <JsonViewer client:load data={json} />\n</main>\n```",
