    "content": "## `container`\n\nYou can change the backgroundCOlor and container classes:\n\n```jsx\n<JsonViewer\n  ...\n  ui={{\n    backgroundColor: \"#f5f5f5\",\n    containerClass: \"border border-gray-300 rounded-lg shadow-md\"\n  }}\n/>\n```\n\n## `font / fonts`\n\nBy default, the font of the JsonViewer is roboto.\n\nYou can change this value using the `font` property:\n\n```jsx\n<JsonViewer\n  ...\n  ui={{\n    font: {\n      family: \"Arial\",\n      size: \"14px\",\n      weight: \"400\",\n    }\n  }}\n/>\n```\n\nOr you can change individual fonts for key and value:\n\n```jsx\n<JsonViewer\n  ...\n  ui={{\n    font: {\n      key: {\n        family: \"Poppins\",\n        size: \"14px\",\n        weight: \"400\",\n      },\n      value: {\n        family: \"Roboto\",\n        size: \"14px\",\n        weight: \"400\",\n      }\n    }\n  }}\n/>\n```\n\n## `colors`\n\nIn this case you have customization for:\n\n- `key`\n- `value types` (string, number, boolean)\n- `null`\n- `keyClass``\n- `valueClass`\n\n```jsx\n<JsonViewer\n  ...\n  ui={{\n    keyColor: \"#ff0000\",\n    valueColor: {\n      string: \"#44fcc2\",\n      number: \"#84d6f7\",\n      boolean: \"#4caf50\",\n    },\n    nullColor: \"#f44336\",\n    keyClass: \"font-bold\",\n    valueClass: \"font-light\",\n  }}\n/>\n```\n\n## Examples\n\nYou can use this examples to customize the JsonViewer and not start from scratch:\n\nPreview:\n\n<JsonViewer\n  data={{\n    name: \"John Doe\",\n    age: 30,\n    email: \"test@test.com\",\n    address: {\n      street: \"123 Main St\",\n      city: \"Springfield\",\n      state: \"IL\",\n      zip: \"62701\",\n    },\n  }}\n  ui={{\n    font: { family: \"Roboto\", weight: \"400\", size: \"14px\" },\n    nullColor: \"#ff0000\",\n    valueColor: {\n      string: \"#00c951\",\n      number: \"#2b7fff\",\n      boolean: \"#2b7fff\",\n    },\n    keyColor: \"#2b7fff\",\n    keyClass: \"font-normal\",\n    valueClass: \"font-normal\",\n    backgroundColor: \"#ff910010\",\n    containerClass: \"bg-transparent max-h-[19 0px] overflow-y-auto rounded-md\",\n  }}\n/>\n\nCode:\n\n```tsx\n<JsonViewer\n  data={{\n    name: \"John Doe\",\n    age: 30,\n    email: \"test@test.com\",\n    address: {\n      street: \"123 Main St\",\n      city: \"Springfield\",\n      state: \"IL\",\n      zip: \"62701\",\n    },\n  }}\n  ui={{\n    font: { family: \"Roboto\", weight: \"400\", size: \"14px\" },\n    nullColor: \"#ff0000\",\n    valueColor: {\n      string: \"#00c951\",\n      number: \"#2b7fff\",\n      boolean: \"#2b7fff\",\n    },\n    keyColor: \"#2b7fff\",\n    keyClass: \"font-normal\",\n    valueClass: \"font-normal\",\n    backgroundColor: \"#ff910010\",\n    containerClass: \"bg-transparent max-h-[19 0px] overflow-y-auto rounded-md\",\n  }}\n/>\n```\n\n---\n\nPreview:\n\n<JsonViewer\n  data={{\n    name: \"John Doe\",\n    age: 30,\n    email: \"test@test.com\",\n    address: {\n      street: \"123 Main St\",\n      city: \"Springfield\",\n      state: \"IL\",\n      zip: \"62701\",\n    },\n  }}\n  ui={{\n    font: { family: \"Poppins\", weight: \"400\", size: \"14px\" },\n    nullColor: \"#2b7fff\",\n    valueColor: {\n      string: \"#00c951\",\n      number: \"#f33f\",\n      boolean: \"#ff0\",\n    },\n    keyColor: \"#2b7fff\",\n    keyClass: \"font-bold\",\n    valueClass: \"font-normal\",\n    backgroundColor: \"#0f0f0f70\",\n    containerClass: \"bg-transparent max-h-[190px] overflow-y-auto rounded-md\",\n  }}\n/>\n\nCode:\n\n```tsx\n<JsonViewer\n  data={{\n    name: \"John Doe\",\n    age: 30,\n    email: \"test@test.com\",\n    address: {\n      street: \"123 Main St\",\n      city: \"Springfield\",\n      state: \"IL\",\n      zip: \"62701\",\n    },\n  }}\n  ui={{\n    font: { family: \"Roboto\", weight: \"400\", size: \"14px\" },\n    nullColor: \"#ff0000\",\n    valueColor: {\n      string: \"#00c951\",\n      number: \"#2b7fff\",\n      boolean: \"#2b7fff\",\n    },\n    keyColor: \"#2b7fff\",\n    keyClass: \"font-normal\",\n    valueClass: \"font-normal\",\n    backgroundColor: \"#ff910010\",\n    containerClass: \"bg-transparent max-h-[19 0px] overflow-y-auto rounded-md\",\n  }}\n/>\n```",
