    "content": "## Framework guides\n\n<FrameworkGuidesComponent />\n\n## Getting Started\n\n1. Install the library:\n\n<InstallLibrary />\n\n2. Add the component:\n\n```jsx {3,8}\n// ðŸ“ƒ app.jsx\n\nimport { JsonViewer } from \"@franmella/json-viewer\";\n\nexport default function App() {\n  return (\n    <div>\n      <JsonViewer />\n    </div>\n  );\n}\n```\n\n3. Usage:\n\n```jsx {3, 6-14, 17-18}\n// ðŸ“ƒ app.jsx\n\nimport { JsonViewer } from \"@franmella/json-viewer\";\n\nexport default function App() {\n  const json = {\n    name: \"John Doe\",\n    age: 30,\n    cars: [\n      { name: \"Ford\", models: [\"Fiesta\", \"Focus\", \"Mustang\"] },\n      { name: \"BMW\", models: [\"320\", \"X3\", \"X5\"] },\n      { name: \"Fiat\", models: [\"500\", \"Panda\"] },\n    ],\n  };\n\n  return (\n    <div>\n      <JsonViewer data={json} />\n    </div>\n  );\n}\n```",
