    "content": "## Create a new Next.js project\n\n1. Run the following command:\n\n```bash\nnpx create-next-app@latest\n```\n\n2. Select the default options:\n\n```bash\nâˆš What is your project named? ... nextjs-project\nâˆš Would you like to use TypeScript? ... Yes\nâˆš Would you like to use ESLint? ... Yes\nâˆš Would you like to use Tailwind CSS? ... Yes (ðŸ‘ˆ optional)\nâˆš Would you like to use `src/` directory? ... Yes (ðŸ‘ˆ optional)\n#...\n```\n\n## Add the library\n\n1. Run the following command:\n\n<InstallLibrary />\n\n2. Add the component to the `app.tsx` file:\n\n> ðŸ’¡ JsonViewer needs `use client` directive.\n\n```tsx {1, 3,8}\n\"use client\";\n\nimport { JsonViewer } from \"@franmella/json-viewer\";\n\nexport default function App() {\n  return (\n    <div>\n      <JsonViewer />\n    </div>\n  );\n}\n```\n\n3. Pass the JSON data to the component:\n\n```tsx {6-16, 20}\n\"use client\";\n\nimport { JsonViewer } from \"@franmella/json-viewer\";\n\nexport default function App() {\n  const json = {\n    name: \"John Doe\",\n    age: 30,\n    email: \"test@test.com\",\n    address: {\n      street: \"123 Main St\",\n      city: \"Springfield\",\n      state: \"IL\",\n      zip: \"62701\",\n    },\n  };\n\n  return (\n    <div>\n      <JsonViewer data={json} />\n    </div>\n  );\n}\n```",
